import numpy as np
from flask import Flask, request, jsonify, render_template
import pickle

# Create flask app
app = Flask(__name__)
model = pickle.load(open(r"model.pkl", "rb"))
dic_in = {
    "Virginica": 0,
    "Setosa": 1,
    "Versicolor": 2
}
image=["data:image/webp;base64,",
           "data:image/jpeg;base64,",
           "data:image/jpeg;base64,"
           ]
@app.route("/")
def Home():
    return render_template("index.html")

@app.route("/predict", methods = ["POST"])
def predict():
    float_features = [float(x) for x in request.form.values()]
    features = [np.array(float_features)]
    prediction_array = model.predict(features)
    
    # Ensure prediction is a string
    if isinstance(prediction_array, np.ndarray):
        prediction = prediction_array[0]  # Extract the first element
    else:
        prediction = prediction_array

    # Ensure the prediction is a valid key
    index = dic_in.get(prediction, 2)  # Default to index 2 if prediction is not found
    img1 = image[index]
    
    return render_template("index.html", prediction_text = "The flower species is {}".format(prediction),img1=img1)

if __name__ == "__main__":
    app.run(host="0.0.0.0")   


